import React from 'react'
import {Link} from 'react-router-dom'

const CreateProjectBouttom  = () => {
    return (
        <React.Fragment>
        <div>
            <Link to="/addProject" 
            className="btn btn-lg btn-info">
                Create a Project
            </Link>
        </div>
        </React.Fragment>
    )
}

export default CreateProjectBouttom;
